import React, {Component} from "react";
import {InputText} from "primereact/inputtext";
import {Button} from "react-bootstrap";
import {Card} from "primereact/card";

export class Rents extends Component {

    constructor(props) {
        super(props);
    }

    render() {


        const header = (<img alt="Card" src='images/usercard.png'/>);
        const footer = (<span> <Button label="Save" icon="pi pi-check" style={{marginRight: '.25em'}}/> <Button label="Cancel" icon="pi pi-times" className="p-button-secondary"/> </span>);


        return (
            <Card footer={footer} header={header}>
                Content
            </Card>
        );
    }
}

export default Rents;
